import React, { useRef } from "react";
import HomeCarousel from "../components/HomeCarousel.tsx";
import "../index.css";
import LatestCollections from "../components/LatestCollections.tsx";
import BestSellers from "../components/BestSellers.tsx";

const Home = () => {
  const latestCollectionsRef = useRef(null);
  const bestSellersRef = useRef(null);

  return (
    <div className="flex flex-col pt-16 w-full h-screen">
      <HomeCarousel 
        latestCollectionsRef={latestCollectionsRef}
        bestSellersRef={bestSellersRef}
      />
      <div ref={latestCollectionsRef}>
        <LatestCollections />
      </div>
      <div ref={bestSellersRef}>
        <BestSellers />
      </div>
    </div>
  );
};

export default Home;
